  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  `is_primary` varchar(45) DEFAULT NULL COMMENT '是否为某系列主要产品\nN：不是（默认）\nY：是\n原则上，一个系列只能有一个主要产品',
  PRIMARY KEY (`id`),
  KEY `idx_product_group_id` (`product_group_id`),
  KEY `idx_product_id` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='详细分组信息';

DROP TABLE IF EXISTS  `product_picture`;
CREATE TABLE `product_picture` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `product_id` int(20) NOT NULL DEFAULT '0' COMMENT '产品ID',
  `full_path` varchar(250) NOT NULL DEFAULT '',
  `original` varchar(250) NOT NULL DEFAULT '' COMMENT '原始图片名',
  `rename` varchar(250) NOT NULL DEFAULT '' COMMENT '重命名文件名',
  `is_cover` varchar(45) NOT NULL DEFAULT 'N' COMMENT '标记封面/主图\nN：普通（默认）\nY：封面',
  `deleted` varchar(45) NOT NULL DEFAULT 'N' COMMENT '标记删除\nN：未删除（默认）\nY：已删除',
  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  `tags` varchar(250) DEFAULT '' COMMENT '可为图片打标签',
  PRIMARY KEY (`id`),
  KEY `idx_product_id` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='产品图片信息';

DROP TABLE IF EXISTS  `product_price`;
CREATE TABLE `product_price` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `product_id` int(20) NOT NULL DEFAULT '0',
  `price_code` varchar(45) NOT NULL DEFAULT '' COMMENT '价格类型，用于提供给不同层面的用户\nCOST(成本价)\nSHOP(批发价)\nRETAIL(零售价)',
  `price_unit_code` varchar(45) NOT NULL DEFAULT '' COMMENT '单位\nRMB_YUAN(默认)\nRMB_FEN',
  `price_value` decimal(12,2) DEFAULT NULL COMMENT '价格值，最多保留2位小数',
  `gmt_expired` datetime DEFAULT NULL,
  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  `remark` varchar(250) DEFAULT '' COMMENT '备注\n成本价\n批发价\n限时促销价\n...',
  `archived` varchar(45) DEFAULT 'N' COMMENT '标记存档\nY：存档\nN：正常（默认）',
  PRIMARY KEY (`id`),
  KEY `idx_product_id` (`product_id`),
  KEY `idx_price_code` (`price_code`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='产品价格描述';

DROP TABLE IF EXISTS  `sys_app`;
CREATE TABLE `sys_app` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `cid` int(20) NOT NULL DEFAULT '0',
  `domain` varchar(45) NOT NULL DEFAULT '' COMMENT '第三方系统的域名',
  `app_key` varchar(45) DEFAULT '' COMMENT 'app key',
  `app_secret` varchar(45) DEFAULT '' COMMENT 'app secret',
  `refresh_token` varchar(45) DEFAULT '' COMMENT '刷新令牌',
  `access_token` varchar(45) DEFAULT '' COMMENT '授权令牌',
  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='第三方服务商连接相关的信息';

DROP TABLE IF EXISTS  `sys_company`;
CREATE TABLE `sys_company` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) NOT NULL DEFAULT '',
  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='登录用户所在组织';

DROP TABLE IF EXISTS  `sys_config`;
CREATE TABLE `sys_config` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `type_config` varchar(45) NOT NULL COMMENT '参数类型',
  `key` varchar(45) NOT NULL,
  `value` varchar(45) DEFAULT NULL,
  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='参数配置信息（v1.0.0暂不使用）';

DROP TABLE IF EXISTS  `sys_log`;
CREATE TABLE `sys_log` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `uid` varchar(45) DEFAULT NULL COMMENT '用户ID：\n0：表示系统\nn：表示用户',
  `operator` varchar(45) DEFAULT NULL COMMENT '操作者：\nSystem：系统\n用户姓名',
  `gmt_log` varchar(45) DEFAULT NULL COMMENT '日志记录时间（JAVA中的时间）',
  `log_level` varchar(45) DEFAULT NULL COMMENT '日志等级：',
  `log_code` varchar(45) DEFAULT NULL COMMENT '日志代号',
  `log` varchar(45) DEFAULT NULL,
  `gmt_created` varchar(45) DEFAULT NULL,
  `gmt_modified` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统日志，记录各种行为（V1.0.0暂不使用）';

DROP TABLE IF EXISTS  `sys_login_remember`;
CREATE TABLE `sys_login_remember` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `uid` int(20) NOT NULL,
  `remember_token` varchar(45) NOT NULL,
  `gmt_expired` datetime DEFAULT NULL COMMENT '过期时间',
  `gmt_refresh` datetime DEFAULT NULL COMMENT '刷新时间',
  `gmt_created` varchar(45) DEFAULT NULL,
  `gmt_modified` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `remember_token_UNIQUE` (`remember_token`),
  KEY `idx_uid` (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=143 DEFAULT CHARSET=utf8 COMMENT='登录记忆';

DROP TABLE IF EXISTS  `sys_user`;
CREATE TABLE `sys_user` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `uid` int(20) NOT NULL DEFAULT '0' COMMENT '用户ID，用户唯一标识，等于注册时accoun对应的ID',
  `classify` varchar(4) NOT NULL DEFAULT '' COMMENT '账户类型：\nA：普通账户\nM：手机号码\nE：Email\n?：待增加类型',
  `account` varchar(36) NOT NULL DEFAULT '' COMMENT '账户内容，可以是普通账户，邮箱账户，电话账户等\n账户组成：账户类型#账户\n例：\nM#13666624372\nE#mays@caiban.net\nA#mays',
  `password` varchar(32) NOT NULL DEFAULT '',
  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  `salt` varchar(32) DEFAULT '' COMMENT '盐',
  `cid` int(20) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `account_UNIQUE` (`account`),
  KEY `idx_uid` (`uid`),
  KEY `idx_password` (`password`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='系统用户信息';

DROP TABLE IF EXISTS  `trade`;
CREATE TABLE `trade` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `cid` int(20) NOT NULL,
  `pid_first` int(20) NOT NULL,
  `trade_num` varchar(45) NOT NULL DEFAULT '' COMMENT '交易编号',
  `source_domain` varchar(45) NOT NULL DEFAULT '' COMMENT '订单来源，域名',
  `source_type` varchar(45) DEFAULT NULL COMMENT '来源类型\nAPI：通过API（默认）\nMANUAL：手动添加',
  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '订单状态\n0：新订单（默认）\n正整数：未完成订单\n负整数：已完成订单',
  PRIMARY KEY (`id`),
  KEY `idx_cid` (`cid`),
  KEY `idx_pid_first` (`pid_first`),
  KEY `idx_trade_num` (`trade_num`)
) ENGINE=InnoDB AUTO_INCREMENT=446 DEFAULT CHARSET=utf8 COMMENT='交易信息';

DROP TABLE IF EXISTS  `trade_define`;
CREATE TABLE `trade_define` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `trade_id` int(20) NOT NULL,
  `details` longtext,
  `gmt_created` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_trade_id` (`trade_id`)
) ENGINE=InnoDB AUTO_INCREMENT=446 DEFAULT CHARSET=utf8 COMMENT='交易相关关的详细信息，一般用于存放第三方信息';

SET FOREIGN_KEY_CHECKS = 1;

